import React, { useState } from 'react';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';


export default function NutritionT() {
    const [open, setOpen] = useState(false);

    const handleClickOpen = () => {
        setOpen(true);
        };
    
        const handleClose = () => {
        setOpen(false);
        };

        
    
    return (
    <div>
        <h2 display="flex" align="center">Nutrition Tracker</h2>
        <Button variant="outlined" color="primary" align="center" display="flex" onClick={handleClickOpen}>
        Open form dialog
        </Button>
        <Dialog open={open} onClose={handleClose} aria-labelledby="form-dialog-title">
        <DialogTitle id="form-dialog-title">Enter food details</DialogTitle>
        <DialogContent>
            <DialogContentText>
            Please enter the name of the food
            </DialogContentText>
            <TextField
            autoFocus
            margin="dense"
            id="name"
            label="Name of food"
            type="text"
            fullWidth
            />
            <TextField
            autoFocus
            margin="dense"
            id="name"
            label="Number of calories"
            type="text"
            fullWidth
            />
        </DialogContent>
        <DialogActions>
            <Button onClick={handleClose} color="primary">
            Cancel
            </Button>
        </DialogActions>
        </Dialog>
    </div>
    );
}
